import React, { useState, useEffect } from 'react';
import axios from 'axios';

const ProductManager = () => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [image, setImage] = useState(null);
  const [products, setProducts] = useState([]);

  // Load products
  const fetchProducts = async () => {
    const res = await axios.get('http://localhost:3001/product/update/');
    setProducts(res.data);
  };

  useEffect(() => {
    fetchProducts();
  }, []);

  // Handle add product
  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!name || !email || !image) return alert('Vui lòng nhập đủ thông tin');

    const formData = new FormData();
    formData.append('name', name);
    formData.append('email', email);
    formData.append('image', image);

    try {
      await axios.post('http://localhost:3001/add-product', formData, {
        headers: { 'Content-Type': 'multipart/form-data' },
      });
      setName('');
      setEmail('');
      setImage(null);
      fetchProducts(); // reload list
    } catch (err) {
      console.error('Upload lỗi:', err.response ? err.response.data : err);
    }
  };

  // Handle delete
  const handleDelete = async (id) => {
    await axios.delete(`http://localhost:3001/products/${id}`);
    fetchProducts();
  };

  return (
    <div>
      <h2>Quản lý sản phẩm</h2>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          placeholder="Tên sản phẩm"
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
        <input
          type="email"
          placeholder="Email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
        />
        <input
          type="file"
          onChange={(e) => setImage(e.target.files[0])}
        />
        <button type="submit">Thêm sản phẩm</button>
      </form>

      <h3>Danh sách sản phẩm</h3>
      <table border="1" cellPadding="10">
        <thead>
          <tr>
            <th>ID</th>
            <th>Tên</th>
            <th>Email</th>
            <th>Hình ảnh</th>
            <th>Sửa</th>
            <th>Xóa</th>
          </tr>
        </thead>
        <tbody>
          {products.map((p) => (
            <tr key={p.id}>
              <td>{p.id}</td>
              <td>{p.name}</td>
              <td>{p.email}</td>
              <td>
                <img
                  src={`http://localhost:3001/uploads/${p.image}`}
                  alt={p.name}
                  width="100"
                />
              </td>
              <td>
                <button onClick={() => alert('Chức năng sửa')}>Sửa</button>
              </td>
              <td>
                <button onClick={() => handleDelete(p.id)}>Xóa</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ProductManager;
